import React from "react";

class Previewer extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
      return (
          <div className="previewer">
              <div className="previewer_header"></div>
              <div className="previewer_body"></div>
          </div>
      );
    }
};

export default Previewer;
